import Contact from "./Contact";

const Contacts = ({ contacts, onDelete, onToggle }) => {
  return (
    <>
      {contacts.map((contact, index) => (
        <Contact
          key={index}
          contact={contact}
          onDelete={onDelete}
          onToggle={onToggle}
        />
      ))}
    </>
  );
};

export default Contacts;
